public class Main {
	public static void main(String[] args) {
		Scanner in=new Scanner(System.in);
		int n= in.nextInt();
		int ranks[] = new int [n];
		for(int i=0;i<n;i++) {
			ranks[i]=in.nextInt();
		}
		int m = in.nextInt();
		for(int i=0;i<m;i++) {
			int g=in.nextInt();
			int h=in.nextInt();
			for(int j=0;j<n;j++) {
				if(g==j+1) {					
					for(int k=0;k<n;k++) {
						if(h==k+1) {
							int temp= ranks[k];
							ranks[k]=ranks[j];
							ranks[j]=temp;
							break;
						}
					}break;
				}
			}
		}
		for(int i=0;i<n-1;i++) {
			System.out.print(ranks[i]+" ");
		}
		System.out.print(ranks[n-1]);
	}
}

