import java.util.Scanner;
public class Main {
    public static void main(String[] args) {
       Scanner scan = new Scanner(System.in);
       int num = scan.nextInt();
       if(num >100||num<1){
           try {
               throw new Exception("超出范围");
           }
           catch (Exception e){
               e.getStackTrace();
           }
       }
       else System.out.println(sum1(num) + "=" +sum(num) );
    }
    public static int sum(int n){
        int result;
        if(n == 1)
            result = 1;
        else result  = n + sum(n-1);
        return result;
    }
    public static String sum1(int n){
        String result;
        if (n == 1 )
        result = 1 + "";
        else if(n==2)
            result = 1+"+" +2;
        else result = sum1(n-1)+ "+"+n  ;
        return result;
    }

}

