public class Main {
	public static int sum_6(int a,int b) {
		if (b==1) {
			return a;
		}else {
			return pow_6(a, b)+sum_6(a, b-1);
		}
	}
	public static int pow_6(int a,int b) {
		int sum =0;
		for (int i = 0; i <b; i++) {
			sum += a*Math.pow(10,i);
		}
		return sum;
	}
	public static void main(String[] args) {
