import java.util.Scanner;
public class Main {
    public static void main(String[] args) {

        //创建新的Scanner的对象（静态方法导入非静态方法：导入该类的包，创建新的变量）
        Scanner scan = new Scanner(System.in);

        int i = scan.nextInt();

        if (i % 100 == 0 ){
            int j = i / 100;
            System.out.println(j);
        }else if (i % 10 == 0){
            int j1 = (i / 10) % 10;
            int j2 = i / 100;
            System.out.println(j1 + "" + j2 );

        }else{
           int last =  i % 10;//(得到最后一个数)
           int mi = (i / 10) % 10;//(得到中间的数)
           int first = i / 100;
           System.out.println(last + "" + mi + first);
        }
    }
}

